<!DOCTYPE html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path4
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(64.5, 50.5);
			ctx.bezierCurveTo(64.5, 70.5, 94.5, 70.5, 94.5, 50.5);
			ctx.bezierCurveTo(94.5, 30.5, 64.5, 30.5, 64.5, 50.5);
			ctx.closePath();
			ctx.stroke();

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(64.366983, 49.37144);
			ctx.lineTo(5.0, 49.5);
			ctx.stroke();
		</script>
	</body>
</html>
